import React from 'react';
import '../scss/Output.scss';




export default function Output({outputColor, outputWidth, outputHeight, outputBorderRadius, handleSetRect}) {
    const rectStyle = {
        backgroundColor: outputColor,
        width: `${outputWidth}px`,
        height: `${outputHeight}px`,
        borderRadius: `${outputBorderRadius}px`
    }


    return (
        <div class='output-rect' style={rectStyle} onChange={() => handleSetRect}>
        </div>
    )
}
